@import url('https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap');
@import url("colors.css");
@import url("button.css");

* {
    margin: 0%;
    padding: 0%;
    font-family: 'Roboto', sans-serif;
}

body {
    background: #f4f4f9;
    color: #333;
    display: flex;
    justify-content: center;
}

header {
    background-color: var(--branco);
    display: flex;
    flex-direction: row;
    padding: 2px;
}

#logo {
    width: 55px;
    margin-top: 5px;
}
.direito{
    width: 90%;
}

.header {
    display: flex;
    height: 20px;
    margin-top: 5px;
    margin-left: 5px;
}

#buttons {
    display: flex;
    flex-direction: row;
    padding: 10px;
    justify-content: space-between;
}

.drop {
    margin-top: 5px;
    margin-left: 10px;
    height: 40px;
}

#submenu.active {
    right: 0;
}

.botao_sair {
    margin-left: 5px;
    margin-top: 5px;
    height: 40px;
}
